#include <stdio.h>
#include <iostream>
#include <string> 
#include <utility>
#include <map>
#include <algorithm>
#include <bitset>
using namespace std;
class Solution {
public:

    void firstUniqChar(string s) {

        int ret = -1; 
        map<char, int> map;
        int i = 0;
        for(char c : s) {
            if (!map.count(c)) {
                map[c] = std::count(s.begin(), s.end(), c);
                if (map[c] == 1 ){
                    ret = i;
                    break;
                }
            }
            i++;
        }


        cout << ret << endl;
        //return ret;
    }


};

int main( int  argc, char* arg[]) {

    
    Solution s = Solution();
    string str = "";
    //string str = "loveleetcode";
    s.firstUniqChar(str);
    //cout << s.firstUniqChar(str) << endl;
    //std::string str;

    return 0;
 };